pragma solidity ^0.5;

import "./BEP20.sol";
import "./openzeppelin-contracts-v2.5/token/ERC20/ERC20Capped.sol";


contract BEP20Mintable is BEP20, ERC20Mintable  {
  uint256 private _cap;

  constructor(string memory _name,string memory  _symbol, uint8 _decimals,uint256 _startingBalance,bool _burnable,uint256 cap)
  BEP20(_name,_symbol,_decimals,_startingBalance,_burnable)
  public {
          _cap = cap;
  }

  function info() public view returns(string memory,string memory,uint8,uint256,uint256,uint256,bool,bool){
    return (name,symbol,decimals,totalSupply(),balanceOf(msg.sender),cap(),burnable,true);
  }
  function mintable() external view returns (bool){
    return true;
  }

  /**
   * @dev Returns the cap on the token's total supply.
   */
  function cap() public view returns (uint256) {
    return _cap;
  }

  function capped() public view returns (bool){
    return _cap!=0;
  }
  /**
   * @dev See {ERC20Mintable-mint}.
   *
   * Requirements:
   *
   * - `value` must not cause the total supply to go over the cap.
   */
  function _mint(address account, uint256 value) internal {
    require(_cap==0 || totalSupply().add(value) <= _cap, "ERC20Capped: cap exceeded");
    super._mint(account, value);
  }
}

